CREATE DEFINER=`root`@`localhost` PROCEDURE `sqlPr_getOverall_Score`()
BEGIN

      Declare Tfirst Double;
      Declare TSecond Double;


        set Tfirst = (Select SOS.SOS_TotalScore from Teams T
        INNER JOIN Participants P ON P.Team_ID = T.Team_ID
        INNER JOIN Attended_SportsEvents ASE ON ASE.Part_ID = P.Part_ID
        INNER JOIN Sports_Overall_Score SOS ON SOS.Ap_ID = ASE.Ap_ID
        Where T.Team_Status = 'Active');


        set TSecond = (Select COS.COS_TotalScore from Teams T
        INNER JOIN Participants P ON P.Team_ID = T.Team_ID
        INNER JOIN Attended_CulturalEvents ACE ON ACE.Part_ID = P.Part_ID
        INNER JOIN Cultural_Overall_Score COS ON COS.ACE_ID = ACE.ACE_ID
