CREATE DEFINER=`root`@`localhost` PROCEDURE `sqlPr_Insert_TempDB`(IN ID Integer,IN Textinput Varchar(25))
BEGIN

        if(Textinput = "LOGIN") then

        if exists (Select 'True' from tempDB Where accountID =  ID) then
          UPDATE tempDB set bol = 1 Where accountID = ID;
        else
          INSERT INTO tempDB(bol,accountID) Values(1,ID);

        end if;

        else if(Textinput = "SUBMIT")then
            UPDATE tempDB set bol = 0 Where accountID = ID;
        else if(Textinput = "LOGOUT")then
            DElete  from  tempDB  Where accountID = ID;
        else
            Update tempDB set bol = 1;
        end if;
        end if;
        end if;

