CREATE DEFINER=`root`@`localhost` PROCEDURE `_criteriascore`(IN pID Varchar(30),
                                                IN cID Varchar(30),
                                                IN crID Varchar(25),
                                                IN score varchar(25),
                                                IN percent Varchar(25),
                                                IN accid Varchar(25),
                                                IN catID VarChar(25),
                                                IN times Varchar(50))
BEGIN
       declare aceid integer;
       declare total double;
       set total = ((percent/100)*score);
       set aceid = (Select ACE_ID from attended_culturalevents Where Part_ID = pID and Cul_ID = cID);


       if exists (Select 'True' from message Where CRID = crID and CatID = catID and CulID = cID and AccountID = accid and PartID = pID)then
         Select ('You had already score this event');
       else
       INSERT INTO message(time,AccountID,CulID,CatID,CRID,PartID)
       Values(TIME_FORMAT(CURTIME(),'%r'),accid,cID,catID,crID,pID);

       insert into criteria_score(Cr_ID,ACE_ID,CrScore,Cr_Computed,Acc_ID) values(crID,aceid,score,total,accid);

       CALL _summation(aceid,catID);
       Select ('Successfully Saved');

       end if; 

END$$

