CREATE DEFINER=`root`@`localhost` PROCEDURE `_selectParticipant`(IN ID varchar(25) )
BEGIN
    Select (AC.ACE_Secnum) id,CONCAT(P.Part_LName, ', ' ,P.Part_FName,' ',P.Part_MName) fulname,T.Team_Name ,(AC.Part_ID) UID
    from Attended_Culturalevents AC
    Inner join Participants P On P.Part_ID = AC.Part_ID
    INNER JOIN Teams T ON T.Team_ID = P.Team_ID
    INNER JOIN Cultural_Events C ON C.Cul_ID = AC.Cul_ID
    Where C.Cul_ID = ID  and Cul_Type_Judging ="INDIVIDUAL" ORDER BY AC.ACE_Secnum;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `_sorting`()
BEGIN
  Delete from sort;
  insert into sort(Points,Team_Name)
  select SUM(pp) score,tn from (Select points as pp,team_name as tn from _totalsport_score UNION Select points as pp,team_name as tn from _totalcultural_score
group by team_name) s group by tn;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `_sportScore`(IN SPID VarChar(25),IN TEAMID VarChar(25),IN Score double,IN ACCID VarChar(25))
BEGIN

     Declare getAPID Integer;
     Declare getpercentage Double;
     Declare computed Double;


     set getAPID = (Select AP_ID from Teams T INNER JOIN Participants P ON P.Team_ID = T.Team_ID
                    INNER JOIN Attended_sportsevents AST ON AST.Part_ID = P.Part_ID
                    Where AST.SP_ID = SPID and T.Team_ID = TEAMID);

     set getpercentage = (Select SP_percentage from Sports_events Where SP_ID = SPID);

     set computed = ((getpercentage/100)*Score);

     insert into sports_score(AP_ID,s_Given_Score,S_CompScore,Acc_ID) Values(getAPID,Score,computed,ACCID);

     CALL _summationSport(TEAMID,SPID);

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `_sport_report`(IN SPname VarChar(50))
BEGIN
     Declare ID Integer;
     set ID = (SELECT SP_ID FROM sports_events Where SP_Name = SPname );
     SELECT *,rank,Score,Team_Name,CONCAT(Acc_LName,', ',Acc_FName,' ',Acc_MName) fullname
     FROM _sport_sorting_score,Accounts s CROSS JOIN Company  Where SP_ID = ID and Acc_Type = 'Sports Judges' GROUP by Rank ASC;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `_summation`(IN ACEID VarChar(25),
                                           IN CATID VarChar(25))
BEGIN

        Declare criteriascoretotal double;
        Declare categoryPercentage double;
        Declare categoryandcriteriatotal double;
        Declare cuturalPercentage double;
        Declare culturalandcategorytotal double;
        Declare getvaluefromresults double;
        Declare getTeamName Varchar(25);
        Declare countnumberinresult integer;
        Declare getIDCultural Integer;
        Declare totaltosaveinresults double;
        Declare lookiftableisempty integer;
        Declare getResultcount Integer;
        Declare getCulturalrankingpointsID Integer;
        Declare getotalscoreinresults double;
        Declare getRpPointinculturalrankingpoints Double;
        Declare allscoreresult Double;
        Declare rppoint Double;
        Declare counttemp Integer;
        Declare getrank Integer;
        Declare getpoints Double;
        Declare count_sumresultsorting Integer;
        Declare getTeamID Integer;
        Declare countresult Integer;
        Declare points Double;
        DEclare getrankinlast Integer;

        set criteriascoretotal = (Select SUM(Cr_Computed) from Event_Category EC
                                  INNER JOIN Criteria_Cultural CC ON EC.Category_ID = CC.Category_ID
                                  INNER JOIN Criteria_Score CS ON CC.Cr_ID = CS.Cr_ID
                                  Where CS.ACE_ID = ACEID and EC.Category_ID = CATID);

       set categoryPercentage = (Select Category_Per from event_category Where Category_ID = CATID);

       set categoryandcriteriatotal = ((categoryPercentage/100)*criteriascoretotal);

       set cuturalPercentage = (Select CE.Cul_Percentage from Cultural_events CE INNER JOIN event_category EC
                                ON CE.Cul_ID = EC.Cul_ID Where EC.Category_ID = CATID);

       set culturalandcategorytotal = ((cuturalPercentage/100)*categoryandcriteriatotal);

       set getIDCultural = (Select CE.Cul_ID from Cultural_events CE INNER JOIN event_category EC
                            ON CE.Cul_ID = EC.Cul_ID Where EC.Category_ID = CATID);

       set getTeamName = (Select T.Team_Name from Teams T INNER JOIN Participants P ON T.Team_ID = P.Team_ID
                        INNER JOIN attended_culturalevents ACE ON P.Part_ID = ACE.Part_ID
                        Where ACE.ACE_ID = ACEID);

       set getTeamID = (Select T.Team_ID from Teams T INNER JOIN Participants P ON T.Team_ID = P.Team_ID
                        INNER JOIN attended_culturalevents ACE ON P.Part_ID = ACE.Part_ID
                        Where ACE.ACE_ID = ACEID);

       set lookiftableisempty = (Select count(*) from Results Where Team_Name = getTeamName and Cul_ID = getIDCultural);

       if(lookiftableisempty = 0)then

          INSERT INTO Results(Team_Name,Score,Cul_ID) Values(getTeamName,culturalandcategorytotal,getIDCultural);


       else
         set getvaluefromresults = (Select SUM(Score) from Results Where Team_Name = getTeamName and Cul_ID = getIDCultural);

         set totaltosaveinresults = (getvaluefromresults+culturalandcategorytotal);
         Delete from Results Where Team_Name = getTeamName and Cul_ID = getIDCultural;
         INSERT INTO Results(Team_Name,Score,Cul_ID) Values(getTeamName,totaltosaveinresults,getIDCultural);


       end if;





END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `_summationSport`(IN TeamID VarChar(25),IN SPID VarChar(25))
BEGIN
     Declare getsporttotal Double;
     Declare getSPortPercentage Double;
     Declare totalsports Double;
     Declare getteamname VarChar(50);
     Declare counttemp Integer;
     Declare getvaluefromtable Double;
     Declare total Double;

     set getsporttotal = (Select SUM(s_CompScore) from Teams T INNER JOIN Participants P ON T.Team_ID = P.Team_ID
                          INNER JOIN attended_sportsevents ASP ON ASP.Part_ID = P.Part_ID
                          INNER JOIN Sports_Score SS ON ASP.AP_ID = SS.AP_ID Where T.Team_ID = TeamID);

    Set getSPortPercentage = (Select SP_Percentage from Sports_Events Where SP_ID = SPID );

    Set totalsports = ((getSPortPercentage/100)*getsporttotal);

    set getteamname = (Select Team_Name from Teams Where Team_ID = TeamID);

    set counttemp = (Select Count(*) from Temp Where Team_Name = getteamname and SP_ID = SPID );

    if( counttemp = 0 ) then

        INSERT INTO Temp(Team_Name,Score,SP_ID) Values(getteamname,totalsports,SPID);
    else
        set getvaluefromtable = (Select SUM(Score) from Temp Where Team_Name = getteamname and SP_ID = SPID );

        set total = (getvaluefromtable+totalsports);
        Delete from temp Where Team_Name = getteamname and SP_ID = SPID;
        INSERT INTO Temp(Team_Name,Score,SP_ID) Values(getteamname,total,SPID);

    end if;

END$$

